import PopupWithForm from './PopupWithForm';

function AddPlacePopup(props) {
    const { isOpen, onClose } = props;
    return (
        <PopupWithForm                
        name='photo'
        title='Новое место'
        buttonText='Создать'

        isOpen={isOpen}
        onClose={onClose}
        >
             <div>
                    <input id="place-input" type="text" name="name" placeholder="Название" className="popup__input" minLength="2"
                    maxlength="30" required />
                    <span className="place-input-error"></span>
                    <input id="link-input" type="url" name="link" placeholder="Ссылка на картинку" className="popup__input" required />
                    <span className="link-input-error"></span>
                </div>

        </PopupWithForm>
    )
}

export default AddPlacePopup;
